function download(e,t,r){var n=document.createElement("a");n.setAttribute("href","data:"+r+";charset=utf-8,"+encodeURIComponent(e)),n.setAttribute("download",t),n.click()}function parseXml(e){var t=null;if(window.DOMParser)try{t=(new DOMParser).parseFromString(e,"text/xml")}catch(r){t=null}else if(window.ActiveXObject)try{t=new ActiveXObject("Microsoft.XMLDOM"),t.async=!1,t.loadXML(e)||window.alert(t.parseError.reason+t.parseError.srcText)}catch(r){t=null}else alert("cannot parse xml string!");return t}function empty(e){return""===e}
